		// Menu fixed
		menuFixed: function () {
			var $header = $('.site-header');
			var topH = $('.top-header').outerHeight();
			var menuH = $header.outerHeight();
			var latestScroll = 0;
			var width = $(window).width();
			var adminbar = ($('#wpadminbar').length > 0) ? $('#wpadminbar').outerHeight() : 0;
			if (width <= 639) {
				adminbar = 0;
			}
			var header_top = 0;
			var $toolbar = $('.toolbar-sidebar');
			var toolbarH = ($toolbar.length > 0) ? $toolbar.outerHeight() : 0;

			var target = header_top + toolbarH + menuH;

			var overlay = $('body').hasClass('thim_header_overlay') ? true : false;
			var position = 'relative';


			if ($('body').hasClass('thim_fixedmenu')) {

				$(window).scroll(function () {

					var current = $(this).scrollTop();

					if ($('body').hasClass('thim-active-search')) {
						$('body').removeClass('thim-active-search');
					}

					if (current >= toolbarH && current > latestScroll) {
						header_top = adminbar;
						position = 'fixed';
						var hClass = 'sticky';
						$header.css({
							position: position,
							top     : header_top
						}).addClass(hClass);
						if (current >= target) {
							if (!$header.hasClass('menu-hidden')) {
								$header.addClass('menu-hidden').removeClass('menu-show');
							}
						}
						;
					}
					if (current <= toolbarH && current < latestScroll) {
						if ($header.hasClass('menu-show')) {
							$header.removeClass('menu-show');
						}

						var hClass = '';
						if (overlay === true) {
							position = 'fixed';
							header_top = toolbarH + adminbar;
							hClass = '';
						} else {
							position = 'absolute';
							header_top = toolbarH;
							hClass = '';
						}

						$header.css({
							position: position,
							top     : header_top
						}).addClass(hClass);
						if (hClass === '') {
							$header.removeClass('sticky');
						}

						var remove_hidden = setInterval(function () {
							$header.removeClass('menu-hidden');
						}, 1000);


						setTimeout(function () {
							clearInterval(remove_hidden);
						}, 500);

					} else if (current > target && current < latestScroll) {
						if ($header.hasClass('menu-hidden')) {
							$header.removeClass('menu-hidden').addClass('menu-show');
						}
						header_top = adminbar;
						position = 'fixed';
						var hClass = 'sticky';
						$header.css({
							position: position,
							top     : header_top
						}).addClass(hClass);
					}

					latestScroll = current;
				});

				if (overlay === false) {
					$('#main-content').css({
						'padding-top': menuH
					});
				}


				setTimeout(function () {
					$header.css({
						top: $toolbar.outerHeight()
					});
				}, 500);
			}

		},

